INSERT INTO `breach_info` VALUES ('0008','00030001','以槽探、坑深方式勘查矿产资源，探矿权人在勘查活动结束后未申请采矿权的，对其勘查矿产资源遗留的钻孔、探井、探槽、巷道未进行回填、封闭，对形成的危岩、危坡未采取治理措施','以槽探、坑深方式勘查矿产资源，探矿权人在勘查活动结束后未申请采矿权的，对其勘查矿产资源遗留的钻孔、探井、探槽、巷道未进行回填、封闭，对形成的危岩、危坡未采取治理措施','县以上人民政府国土资源行政主管部门责令限期改正；逾期拒不改正的，国土资源管理部门5年内不受理其新的探矿权、采矿权申请。','《国土资源部矿山地质环境保护规定》（国土资源部令第44号）第33条：探矿权人以槽探、坑探方式勘查矿产资源，在矿产资源勘查活动结束后未申请采矿权的，未采取治理恢复措施的，由县级以上国土资源行政主管部门责令限期改正；逾期拒不改正的，处3万元以下的罚款，5年内不受理其新的探矿权、采矿权申请。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','探矿权人以槽探、坑探方式勘查矿产资源，在矿产资源勘查活动结束后未申请采矿权的，未采取治理恢复措施'),('0009','00030001','未按规定汇交地质资料','未按《地质资料管理条例》规定的期限汇交地质资料的。','负责接收地质资料的行政主管部门责令限期汇交，逾期不汇交的，予以通报，自发布通报之日起至逾期未汇交的资料全部汇交之日止，该汇交人不得申请新的探矿权、采矿权，不得承担国家出资的地质工作项目。','《地质资料管理条例》第20条：未依照本条例规定的期限汇交地质资料的，由负责接收地质资料的地质矿产主管部门责令限期汇交；逾期不汇交的，处１万元以上５万元以下罚款，并予以通报，自发布通报之日起至逾期未汇交的资料全部汇交之日止，该汇交人不得申请新的探矿权、采矿权，不得承担国家出资的地质工作项目。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','未按规定汇交地质资料'),('0020','00050006','未按规定提供国土资源监测服务','未按照合同约定时间提交国土资源监测成果。','发生1次，限期整改，并通报批评；同一年度发生达到2次，国土资源管理部门不得委托其开展下一年度的监测活动。',' 1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0015','00050005','在评估中弄虚作假或者故意隐瞒地质灾害真实情况','被依法责令停业整顿。','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估。','    1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','在评估中弄虚作假或者故意隐瞒地质灾害真实情况被依法责令停业整顿的'),('00150001','00050005',NULL,'被依法降低资质等级。','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估。','    1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0016','00050005','无资质证书、或超越其资质登记许可的范围、或以其他单位的名义承揽地质灾害性评估业务','被依法责令停业整顿。','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估。','    1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0040','0010','违反招标规定','投标人以他人名义投标或者以其他方式弄虚作假骗取中标','情节严重的，取消其一年至三年内参加依法必须进行招标的项目的投标资格',' 1.《中华人民共和国招投标法》54条：投标人以他人名义投标或者以其他方式弄虚作假，骗取中标的，中标无效，给招标人造成损失的，依法承担赔偿责任；构成犯罪的，依法追究刑事责任。依法必须进行招标的项目的投标人有前款所列行为尚未构成犯罪的，处中标项目金额千分之五以上千分之十以下的罚款，对单位直接负责的主管人员和其他直接责任人员处单位罚款数额百分之五以上百分之十以下的罚款；有违法所得的，并处没收违法所得；情节严重的，取消其一年至三年内参加依法必须进行招标的项目的投标资格并予以公告，直至由工商行政管理机关吊销营业执照。\r\n    2.《中华人民共和国招标投标法实施条例》68条：投标人以他人名义投标或者以其他方式弄虚作假骗取中标的，中标无效；构成犯罪的，依法追究刑事责任；尚不构成犯罪的，依照招标投标法第五十四条的规定处罚。依法必须进行招标的项目的投标人未中标的，对单位的罚款金额按照招标项目合同金额依照招标投标法规定的比例计算。投标人有下列行为之一的，属于招标投标法第五十四条规定的情节严重行为，由有关行政监督部门取消其1年至3年内参加依法必须进行招标的项目的投标资格：（一）伪造、变造资格、资质证书或者其他许可证件骗取中标；（二）3年内2次以上使用他人名义投标；（三）弄虚作假骗取中标给招标人造成直接经济损失30万元以上；（四）其他弄虚作假骗取中标情节严重的行为。 投标人自本条第二款规定的处罚执行期限届满之日起3年内又有该款所列违法行为之一的，或者弄虚作假骗取中标情节特别严重的，由工商行政管理机关吊销营业执照。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0027','00070001','未全面履行土地整治项目设计义务','设计单位未按照合同约定的时间提交土地整治项目设计成果。','每发现1次，国土资源管理部门予以通报批评1次。同一年度内,被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目设计。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1401',NULL,0,NULL,NULL),('00270001','00070001',NULL,'设计单位未按照农村土地整治有关标准、规范及土地整治项目设计合同约定，编制完整的项目设计成果（包括工程施工设计）。','每发现1次，国土资源管理部门予以通报批评1次。同一年度内，被通报批评达2次(含)以上的，国土资源管理部门不得委托其开展下一年度土地整治项目设计。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1401',NULL,0,NULL,NULL),('0039','0010','违反招标规定','投标人相互串通投标或者与招标人串通投标的，投标人向招标人或者评标委员会成员行贿谋取中标','情节严重的，取消其一年至二年内参加国土资源依法必须进行招标的项目的投标资格并予以公告','《招标拍卖挂牌出让国有建设用地使用权规定》（国土资源部第39号令）第20条: “以招标、拍卖或者挂牌方式确定中标人、竞得人后，中标人、竞得人支付的投标、竞买保证金，转作受让地块的定金。出让人应当向中标人发出中标通知书或者与竞得人签订成交确认书。中标通知书或者成交确认书应当包括出让人和中标人或者竞得人的名称，出让标的，成交时间、地点、价款以及签订国有建设用地使用权出让合同的时间、地点等内容。 中标通知书或者成交确认书对出让人和中标人或者竞得人具有法律效力。出让人改变竞得结果，或者中标人、竞得人放弃中标宗地、竞得宗地的，应当依法承担责任。”矿业权招标、拍卖、挂牌参照执行。\r\n    说明： 国土资源管理部门在出让土地使用权或矿业权时，将该失信行为以及相应的惩戒措施写入招标、拍卖、挂牌出让公告。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0028','00070001','未全面履行土地整治项目施工义务','施工单位未按照项目设计和有关技术标准进行施工。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00200001','00050006',NULL,'国土资源监测成果质量不符合要求。','经检查验收质量不合格的，被约谈1次的，通报批评；约谈2次及以上的，在2年内，国土资源管理部门不得委托其开展监测活动；','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',1,0,NULL,NULL,0,NULL,NULL),('0035','00070004','违反安徽省地质勘查基金项目管理规定','项目承担单位未按规定报送季报、半年报及年报，责令其限期报送，逾期仍不报送。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省地质勘查基金项目管理暂行办法》（皖国土资[2007]85号）第28条：“项目承担单位和个人违反本办法规定，视情节轻重，省国土资源厅将对其进行通报批评、停止拨款、终止项目、收回已拨项目经费、取消项目申报资格等处罚。情节严重者依据有关规定追究相应的经济和法律责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1501',NULL,0,NULL,NULL),('00200002','00050006',NULL,'监测单位故意弄虚作假，情节严重的。',' 3年内，国土资源管理部门不得委托其开展监测活动。',' 1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0052','00050001','土地评估机构影响委托单位对土地估价机构自主选择；使用其他机构的土地估价师参与本机构土地评估业务且未经其所在机构同意；土地估价报告备案被国土行政主管部门退件','土地评估机构影响委托单位对土地估价机构自主选择；使用其他机构的土地估价师参与本机构土地评估业务且未经其所在机构同意；土地估价报告备案被国土行政主管部门退件','处纠错检查，并记2分','《安徽省土地估价行业违规处罚记分办法》（试行）第12条。',0,NULL,1,0,'superadmin','2016-05-30 19:13:56',1,0,NULL,NULL,0,NULL,NULL),('0051','00050001','虚假宣传；妨碍本机构内执业土地估价师参加继续教育学习','虚假宣传；妨碍本机构内执业土地估价师参加继续教育学习','警示提醒，并记1分','《安徽省土地估价行业违规处罚记分办法（试行）》（皖估协发【2013】06号）第11条。',0,NULL,1,0,'superadmin','2016-05-30 19:09:58',1,0,NULL,NULL,0,NULL,NULL),('0053','00050001','土地评估机构以不正当手段争揽业务；在土地估价报告年度抽检或随机检查中有不合格；未按规定进行土地估价报告电子化备案；重大项目不执行评估指引条款但未对行业声誉造成不良影响','土地评估机构以不正当手段争揽业务；在土地估价报告年度抽检或随机检查中有不合格；未按规定进行土地估价报告电子化备案；重大项目不执行评估指引条款但未对行业声誉造成不良影响','责令整改，记3分。并可视违规情节加处警示提醒、纠错检查','《安徽省土地估价行业违规处罚记分办法》（试行）第13条。',0,NULL,1,0,'superadmin','2016-05-30 19:16:43',1,0,NULL,NULL,0,NULL,NULL),('0054','00050001','没有严格保守商业秘密；；本机构冒名顶替承揽土地评估业务；让其他机构冒名顶替承揽土地评估业务','没有严格保守商业秘密；；本机构冒名顶替承揽土地评估业务；让其他机构冒名顶替承揽土地评估业务','注销资级，记4分。并可根据违规情节加处警示提醒、责令整改、通报批评等处罚','《安徽省土地估价行业违规处罚记分办法》（试行）第14条',0,NULL,1,0,'superadmin','2016-05-30 19:18:43',1,0,NULL,NULL,0,NULL,NULL),('0055','00050001','出具失实土地估价报告；超出范围承接业务；擅自设立分支机构','出具失实土地估价报告；超出范围承接业务；擅自设立分支机构','暂停注册，记6分。并可根据违规情节加处警示提醒、纠错检查、责令整改、通报批评、注销资级等处罚','《安徽省土地估价行业违规处罚记分办法》（试行）第15条。',0,NULL,1,0,'superadmin','2016-05-30 19:20:32',1,0,NULL,NULL,0,NULL,NULL),('0056','00050001','出具重大失实土地估价报告，造成严重社会后果；在土地估价报告年度抽检中连续2年不合格的；取不正当利益；在一个处罚记分周期内虽无严重违规行为、但多次重复违规。累计罚分达到或超过12分的','出具重大失实土地估价报告，造成严重社会后果；在土地估价报告年度抽检中连续2年不合格的；取不正当利益；在一个处罚记分周期内虽无严重违规行为、但多次重复违规。累计罚分达到或超过12分的','暂停注册，记12分。并根据违规情节加处警示提醒、责令整改、通报批评、注销资级、暂停注册等','《安徽省土地估价行业违规处罚记分办法》（试行）第16条',0,NULL,1,0,'superadmin','2016-05-30 19:23:25',1,0,NULL,NULL,0,NULL,NULL),('0057','00050001','暂停注册处罚期间，仍承揽业务；私自出借或转让《土地估价中介机构注册证书》；弄虚作假；被工商行政主管部门注销其企业营业执照；受到暂停注册处罚后拒绝整改或整改后未通过复查；构成犯罪并被司法部门依法查处','暂停注册处罚期间，仍承揽业务；私自出借或转让《土地估价中介机构注册证书》；弄虚作假；被工商行政主管部门注销其企业营业执照；受到暂停注册处罚后拒绝整改或整改后未通过复查；构成犯罪并被司法部门依法查处','注销资质','《安徽省土地估价行业违规处罚记分办法》（试行）第17条',0,NULL,1,0,'superadmin','2016-05-30 19:27:13',1,0,NULL,NULL,0,NULL,NULL),('00270003','00070001',NULL,'1.设计单位不按照合同约定参与设计交底；2.不按照合同约定提供施工阶段的有关设计的咨询、指导等设计服务的；3.不按照合同约定提供施工阶段的有关设计的修改完善、变更等设计服务的；4.不按照合同约定参与业主单位组织的项目单位工程和重大隐蔽单元工程验收以及各级国土资源管理部门竣工验收。','该4种情形每种情形每发生1次，国土资源行政主管部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目设计。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1401',NULL,0,NULL,NULL),('0017','00050005','允许其他单位以本单位的名义承揽地质灾害危险性评估业务','被依法责令停业整顿。','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估。','    1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00170001','00050005',NULL,'被依法降低资质等级。','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估。','    1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0018','00050005','在签订地质灾害危险性评估项目合同后，未按规定到项目所在地的国土资源管理部门进行资质和项目备案','被责令限期改正。','改正前，国土资源管理部门不委托其开展地质灾害危险性评估。',' 1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》要求（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2. 国土资源部《地质灾害危险性评估单位资质管理办法》第27条：“资质单位应当在签订地质灾害危险性评估项目合同后十日内，到项目所在地的县级国土资源管理部门进行资质和项目备案。评估项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。” 第30条：“资质单位违反本办法第二十七条的规定，不按时进行资质和项目备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下的罚款。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00180001','00050005',NULL,'逾期未改正被依法处罚，或者1年内未按规定备案达2次。','自行政处处罚履行或者责令限期改正之日起6个月内，国土资源管理部门不得委托其开展地质灾害危险性评估。',' 1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》要求（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2. 国土资源部《地质灾害危险性评估单位资质管理办法》第27条：“资质单位应当在签订地质灾害危险性评估项目合同后十日内，到项目所在地的县级国土资源管理部门进行资质和项目备案。评估项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。” 第30条：“资质单位违反本办法第二十七条的规定，不按时进行资质和项目备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下的罚款。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0019','00050005','地质灾害危险性评估资质单位承担的地质灾害危险性评估项目发生重大质量事故','被降低资质等级。','自被降低资质等级之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估。',' 1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2.国土资源部《地质灾害危险性评估单位资质管理办法》第26条：“资质单位承担的地质灾害危险性评估项目发生重大质量事故的，资质单位应当停止从业活动，由原审批机关对其资质等级进行重新核定。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0025','00050003','未遵守执业准则','执业的土地登记代理人数未达到规定要求','年检不予通过','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00250001','00050003',NULL,'提交的土地登记申请材料发现有弄虚作假或一年中累计3次以上未达到规定的精度要求','年检不予通过','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00250002','00050003',NULL,'无正当理由逾期不参加年检的','年检不予通过','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',