L,0,NULL,NULL),('00260002','00050004',NULL,'其他违法违规评估行为','终止采购合同，取消政府矿业权价款评估项目','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',0,NULL,0,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0002','0004','闲置土地','超过建设用地使用权出让合同约定的动工时间一年未动工建设。因不可抗力或者政府、政府有关部门的行为或者动工开发必须的前期工作造成动工开发迟延的除外。','在改正或者接受政府依法处置完毕前，国土资源管理部门暂不受理其新的建设用地的申请。','《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0004','闲置土地'),('00020001','0004',NULL,'依据《闲置土地处置办法》（国土资源部53号令），已动工开发但开发建设用地面积占应动工开发建设用地总面积不足三分之一或者已投资额占总投资额不足百分之二十五，中止开发建设满一年的也视为闲置土地。因不可抗力或者政府、政府有关部门的行为或者动工开发必需的前期工作造成动工开发迟延的除外。',' 在改正或者接受政府依法处置完毕前，国土资源管理部门暂不受理其新的建设用地的申请。','《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','闲置土地'),('0003','0004','擅自改变土地用途','未经依法批准擅自改变土地用途。','在全面履行处罚决定前，国土资源管理部门暂不受理其新的建设用地申请。','《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。” ',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0004','擅自改变土地用途'),('0004','0004','未履行土地复垦义务','土地复垦义务人在规定的时间内没有复垦或者复垦土地不符合要求。','在土地复垦成果通过验收前，土地复垦义务人在申请新的建设用地时，有批准权的人民政府不得批准。','国务院《土地复垦条例》第20条：“土地复垦义务人不依法履行土地复垦义务的，在申请新的建设用地时，有批准权的人民政府不得批准。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,1,NULL,NULL),('0005','0004','非法转让建设用地','违反法律法规规定将土地使用权单独或者随同地上建筑物转让。','在全面履行处罚决定前，国土资源管理部门暂不受理其新的建设用地申请。','《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0004','非法转让国有建设用地'),('0006','00030001','拖欠探矿权价款或探矿权使用费','未按照探矿权出让合同约定缴纳探矿权价款，未按规定缴纳探矿权使用费','在足额缴纳探矿权价款和探矿权使用费以及滞纳金前，国土资源管理部门对其矿业权申请审批予以限制。满3年未履行付清义务的，依法予以禁入。','国土资源部《矿业权人勘察开采信息公示办法（试行）》（国土资规[2015]6号）第31条：“国土资源主管部门在国土资源专项资金审批、国土资源领域工程招投标、国有土地出让、矿业权审批、授予荣誉称号等中，将矿业权人勘察开采信息公示结果作为重要考量因素，对矿业权人被列入异常名录的应依法予以限制，对矿业权人被列入严重违法名单的应依法予以禁入。第23条将未按照探矿权出让合同约定支付探矿权价款和探矿权使用费列入异常名录，满3年的列入严重违法名单。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0007','00030001','因违法被依法吊销勘查许可证','因违法被依法吊销勘查许可证','自勘查许可证被吊销之日起6个月内，国土资源管理部门不受理其新的探矿权申请。','《矿产资源勘查区块登记管理办法》（国务院第240号令）第33条：“探矿权人被吊销勘查许可证的，自勘查许可证被吊销之日起６个月内，不得再申请探矿权。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','被吊销勘查许可证'),('00280001','00070001',NULL,'项目施工单位未建立质量责任制，未确定工程及工段的项目经理、技术负责人和施工管理负责人。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00280004','00070001',NULL,'项目施工单位没有做到：加强工程建设资金管理，做到专款专用；实行项目资金专户管理和独立核算制度、财务管理人员（财务主管和出纳）须是本单位人员，项目资金的使用由项目经理负责签字、审批；承诺及时支付农民工工资。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00350001','00070004',NULL,'基金项目实施过程中，承担单位未经省国土资源厅书面批准擅自对项目的工作地区、目标任务、工作周期、工程布置、主要实物工作量、经费使用等进行调整的。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省地质勘查基金项目管理暂行办法》（皖国土资[2007]85号）第28条：“项目承担单位和个人违反本办法规定，视情节轻重，省国土资源厅将对其进行通报批评、停止拨款、终止项目、收回已拨项目经费、取消项目申报资格等处罚。情节严重者依据有关规定追究相应的经济和法律责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1501',NULL,0,NULL,NULL),('00350002','00070004',NULL,'项目成果经评审不合格。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省地质勘查基金项目管理暂行办法》（皖国土资[2007]85号）第28条：“项目承担单位和个人违反本办法规定，视情节轻重，省国土资源厅将对其进行通报批评、停止拨款、终止项目、收回已拨项目经费、取消项目申报资格等处罚。情节严重者依据有关规定追究相应的经济和法律责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1501',NULL,0,NULL,NULL),('0036','00070004','违反安徽省公益性地质工作项目管理规定','项目承担单位不严格执行合同。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省公益性地质工作项目管理暂行办法》（皖国土资[2007]122号）第52条：“项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果地质资料的，按国务院《地质资料管理条例》第二十条、第二十一条规定处理。对不严格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1502',NULL,0,NULL,NULL),('00360001','00070004',NULL,'不按规定提交项目工作报告。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省公益性地质工作项目管理暂行办法》（皖国土资[2007]122号）第52条：“项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果地质资料的，按国务院《地质资料管理条例》第二十条、第二十一条规定处理。对不严格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1502',NULL,0,NULL,NULL),('00280007','00070001',NULL,'项目施工单位没有做到：在工程最终办理移交证书之前的整个施工期内，制定并实施一切必要的措施，保证工程现场安全（包括承包方和非承包方的人员安全），维护工地的生产、生活秩序。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理不得委托其开展下一年度土地整治项目施工。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('0029','00070001','未全面履行土地整治项目监理义务','监理单位没有做到：按照合同条款约定的时间内组建监理机构，并进驻现场，及时将监理规划、监理机构及其主要人员名单提交委托人，将监理机构及其人员名单、监理工程师和监理员的授权范围通知承包人（实施期间有变化的，应当及时通知承包人。更换总监理工程师和其他主要监理人员应征得委托人同意）。','每种情形发生1次，国土资源管理管部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1403',NULL,0,NULL,NULL),('00290001','00070001',NULL,'监理单位没有做到：核验建筑材料、建筑构配件和设备质量，检查、检验并确认工程的施工质量；检查施工安全生产情况。发现存在质量、安全事故隐患，或发生质量、安全事故，应按有关规定及时采取相应的监理措施。监理单位没有做到：监督、检查、控制工程施工进度。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1403',NULL,0,NULL,NULL),('00360002','00070004',NULL,'私自截留、挪用项目资金。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省公益性地质工作项目管理暂行办法》（皖国土资[2007]122号）第52条：“项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果地质资料的，按国务院《地质资料管理条例》第二十条、第二十一条规定处理。对不严格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1502',NULL,0,NULL,NULL),('00360003','00070004',NULL,'项目成果经评审不合格。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省公益性地质工作项目管理暂行办法》（皖国土资[2007]122号）第52条：“项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果地质资料的，按国务院《地质资料管理条例》第二十条、第二十一条规定处理。对不严格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1502',NULL,0,NULL,NULL),('0037','00070004','违反安徽省省外境外地质勘查基金项目申报规定','省外境外地质勘查基金项目申请人采用虚假手段骗取地质勘查基金，截留、挪用省地质勘查基金项目经费，伪造、隐匿技术资料和成果资料的。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省省外境外地质勘查基金项目申报暂行办法》（皖国土资[2008]337号）第14条：“采用虚假手段骗取地质勘查基金，截留、挪用省地质勘查基金项目经费，伪造、隐匿技术资料和成果资料的，省地勘基金管理机构有权全额收回项目基金，取消以后年度项目申请资格，并追究其经济和法律责任。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1503',NULL,0,NULL,NULL),('00370001','00070004',NULL,'项目成果经评审不合格。',NULL,'1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.《安徽省省外境外地质勘查基金项目申报暂行办法》（皖国土资[2008]337号）第14条：“采用虚假手段骗取地质勘查基金，截留、挪用省地质勘查基金项目经费，伪造、隐匿技术资料和成果资料的，省地勘基金管理机构有权全额收回项目基金，取消以后年度项目申请资格，并追究其经济和法律责任。”\r\n',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1503',NULL,0,NULL,NULL),('0038','0010','未按成交确认书签订出让合同','签订国有建设用地使用权（矿业权）成交确认书、收到到中标通知书后，未在规定期限签订建设用地使用权（矿业权）出让合同','禁止其1年内参加国有建设用地使用权（矿业权）招标、拍卖、挂牌活动','《招标拍卖挂牌出让国有建设用地使用权规定》（国土资源部第39号令）第20条: “以招标、拍卖或者挂牌方式确定中标人、竞得人后，中标人、竞得人支付的投标、竞买保证金，转作受让地块的定金。出让人应当向中标人发出中标通知书或者与竞得人签订成交确认书。中标通知书或者成交确认书应当包括出让人和中标人或者竞得人的名称，出让标的，成交时间、地点、价款以及签订国有建设用地使用权出让合同的时间、地点等内容。 中标通知书或者成交确认书对出让人和中标人或者竞得人具有法律效力。出让人改变竞得结果，或者中标人、竞得人放弃中标宗地、竞得宗地的，应当依法承担责任。”矿业权招标、拍卖、挂牌参照执行。\r\n    说明： 国土资源管理部门在出让土地使用权或矿业权时，将该失信行为以及相应的惩戒措施写入招标、拍卖、挂牌出让公告。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00230002','00050002',NULL,'涂改、伪造、出借、转让资格证书，或者允许其他机构以本机构名义承担项目的','具有以上失信情形的，不予评选推荐；已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。\r\n',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00230001','00050002',NULL,'转包土地利用规划编制、咨询、业务的','具有以上失信情形的，不予评选推荐；已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。\r\n',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00230003','00050002',NULL,'存在严重违法违规行为，给社会和行业声誉造成恶劣影响的','具有以上失信情形的，不予评选推荐；已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。\r\n',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00240001','00050002',NULL,'给予丙级机构撤销推荐；收回资格证书并向社会公布','给予土地规划乙级机构推荐名录降为丙级机构推荐名录；','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00330002','00070003',NULL,'以其他单位的名义或者允许其他单位以本单位的名义承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务。','被责令停止相关业务的，在改正前不得承担新的地质灾害治理工程项目勘查、设计、施工、监理项目。被吊销相应资质证书的，不得开展勘查、设计、施工、监理活动','《安徽省矿山地质环境保护条例》第43条:违反本条例第二十四条、第二十五条规定，有下列行为之一的，由县以上人民政府国土资源行政主管部门或者其他部门依据职责责令停止违法行为，对承担矿山地质环境治理恢复业务的勘查、设计、监理单位处合同约定的勘查费、设计费、监理费1倍以上2倍以下的罚款，对承担矿山地质环境治理恢复业务的施工单位处工程价款2%以上4%以下的罚款，并责令停止相应业务，降低相应资质等级；有违法所得的，没收违法所得；情节严重的，吊销相应资质证书：（一）无相应资质或者超越资质等级许可的范围承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的；（二）在矿山地质环境治理恢复工程的勘查、设计、施工以及监理活动中弄虚作假、降低治理恢复工程质量的；（三）以其他单位的名义或者允许其他单位以本单位的名义承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0034','00070004','被吊销地质勘查资质证书','被吊销地质勘查资质证书','自吊销之日起1年内，国土资源管理部门不受理其重新申请地质勘查资质。','《地质勘查资质管理条例》（国务院令第520号）第33条：“违反本条例规定被依法吊销地质勘查资质证书的单位，自吊销之日起1年内不得重新申请地质勘查资质。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','因违法被吊销地质勘查资质证书'),('00470002','0006',NULL,'测绘成果质量经测绘地理信息质检机构判定为批不合格','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位受到测绘地理信息行政主管部门及相关部门行政处罚的，计入该单位的严重失信信息，自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:14:06',0,0,NULL,NULL,0,NULL,NULL),('0001','0004','拖欠土地使用权出让金','未按照土地使用权出让合同约定缴纳土地使用权出让金。','在足额缴纳土地使用权出让金以及违约金前，国土资源管理部门暂不受理其新的建设用地申请。','《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。” ',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0043','0008','被行政处罚','被行政处罚','被处罚向社会公开。','《安徽省人民政府办公厅关于印发安徽省公共信用信息征集共享使用暂行办法的通知》（皖政办【2015】47号）',0,NULL,1,0,'superadmin','2016-05-04 14:00:32',0,0,NULL,NULL,0,NULL,NULL),('0044','0008','不履行行政处罚决定书','不履行行政处罚决定书','向社会公开。','《安徽省人民政府办公厅关于印发安徽省公共信用信息征集共享使用暂行办法的通知》（皖政办【2015】47号）',0,NULL,1,0,'superadmin','2016-05-04 14:00:57',0,0,NULL,NULL,0,NULL,NULL),('0045','0008','被行政强制','被行政强制','向社会公开。','《安徽省人民政府办公厅关于印发安徽省公共信用信息征集共享使用暂行办法的通知》（皖政办【2015】47号）',0,NULL,1,0,'superadmin','2016-05-04 14:01:19',0,0,NULL,NULL,0,NULL,NULL),('0042','00050007','未按规定提供国土资源科技项目服务','项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果资料','按《中华人民共和国促进科技成果转化法》第四十六条、第四十七条规定处理\r\n','按《中华人民共和国促进科技成果转化法》第四十六条、第四十七条',0,NULL,1,0,'superadmin','2016-04-18 20:21:49',0,0,NULL,NULL,0,NULL,NULL),('00280002','00070001',NULL,'项目施工单位未对出现质量问题或验收不合格的工程及时进行返工或返修。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00280003','00070001',NULL,'项目施工单位未对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00280005','00070001',NULL,'施工单位未按照合同约定按时完成工程建设任务。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00160001','00050005',NULL,'被依法降低资质等级。','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估。','    1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0032','00070002','无资质证书、或超越其资质登记许可的范围、以其他单位的名义承揽地质灾害治理工程勘查、设计、施工、监理资质单位业务，或者允许其他单位以本单位的名义承揽地质灾害治理工程勘查、设计、施工、监理资质单位业务','被责令停业整顿。','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00040001','0004',NULL,'未按规定预存土地复垦费用。','责令限期改正。','国土资源部《土地复垦条例实施办法》第五十一条：“土地复垦义务人未按照本办法第十六条、第十七条、第十八条、第十九条规定预存土地复垦费用的，由县级以上国土资源主管部门责令限期改正，逾期不改正的，依照本条例第三十八条规定处罚。”',0,NULL,1,0,'superadmin','2016-06-15 09:19:42',0,0,NULL,NULL,0,NULL,NULL),('00290005','00070001',NULL,'监理单位没有做到：编制《监理日志》，并向委托人提交监理月报、监理专题报告、监理工作报告和监理工作总结报告。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1403',NULL,0,NULL,NULL),('00290006','00070001',NULL,'监理单位没有做到：按有关规定参加工程验收，做好相关配合工作。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1403',NULL,0,NULL,NULL),('0030','00070002','地质灾害治理工程勘查、设计、施工、监理资质单位在签订地质灾害治理工程勘查、设计、施工、监理项目合同后，未到项目所在地的国土资源管理部门进行资质和项目备案','被责令限期改正。','改正前，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2.国土资源部《地质灾害治理工程勘查设计施工单位资质管理办法》第27条：“承担地质灾害治理工程项目的资质单位，应当在项目合同签订后十日内，到工程所在地的县级国土资源管理部门备案。地质灾害治理工程项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。”第29条：“资质单位不按照本办法第二十七条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期仍不改正的逾期不改的，可以处一万元以下罚款。”\r\n    3.国土资源部《地质灾害治理工程监理单位资质管理办法》第25条：“地质灾害治理工程监理资质单位，对承担的监理项目，应当在监理合同签订后十日内，到工程所在地县级国土资源管理部门备案。监理项目跨行政区域的，向项目所跨行政区域共同的上一级国土资源管理部门备案。”第27条：“资质单位不按照本办法第二十五条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下罚款。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00300001','00070002',NULL,'逾期未改正被依法处罚，或者在1年内未按规定备案达2次。','自处罚履行或者被责令限期改正之日起6个月内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2.国土资源部《地质灾害治理工程勘查设计施工单位资质管理办法》第27条：“承担地质灾害治理工程项目的资质单位，应当在项目合同签订后十日内，到工程所在地的县级国土资源管理部门备案。地质灾害治理工程项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。”第29条：“资质单位不按照本办法第二十七条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期仍不改正的逾期不改的，可以处一万元以下罚款。”\r\n    3.国土资源部《地质灾害治理工程监理单位资质管理办法》第25条：“地质灾害治理工程监理资质单位，对承担的监理项目，应当在监理合同签订后十日内，到工程所在地县级国土资源管理部门备案。监理项目跨行政区域的，向项目所跨行政区域共同的上一级国土资源管理部门备案。”第27条：“资质单位不按照本办法第二十五条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下罚款。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0031','00070002','在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量','被责令停业整顿。','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00310001','00070002',NULL,'被降低资质等级。','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理。',' 1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” \r\n    2.国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00320001','00070002',NULL,'被降低资质等级。','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。” ',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0033','00070003','违规实施矿山地质环境治理项目勘查、设计、施工、监理行为','无相应资质或者超越资质等级许可的范围承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务。','被责令停止相关业务的，在改正前不得承担新的地质灾害治理工程项目勘查、设计、施工、监理项目。被吊销相应资质证书的，不得开展勘查、设计、施工、监理活动。','《安徽省矿山地质环境保护条例》第43条:违反本条例第二十四条、第二十五条规定，有下列行为之一的，由县以上人民政府国土资源行政主管部门或者其他部门依据职责责令停止违法行为，对承担矿山地质环境治理恢复业务的勘查、设计、监理单位处合同约定的勘查费、设计费、监理费1倍以上2倍以下的罚款，对承担矿山地质环境治理恢复业务的施工单位处工程价款2%以上4%以下的罚款，并责令停止相应业务，降低相应资质等级；有违法所得的，没收违法所得；情节严重的，吊销相应资质证书：（一）无相应资质或者超越资质等级许可的范围承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的；（二）在矿山地质环境治理恢复工程的勘查、设计、施工以及监理活动中弄虚作假、降低治理恢复工程质量的；（三）以其他单位的名义或者允许其他单位以本单位的名义承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00330001','00070003',NULL,'在矿山地质环境治理恢复工程的勘查、设计、施工以及监理活动中弄虚作假、降低治理恢复工程质量。','被责令停止相关业务的，在改正前不得承担新的地质灾害治理工程项目勘查、设计、施工、监理项目。被吊销相应资质证书的，不得开展勘查、设计、施工、监理活动','《安徽省矿山地质环境保护条例》第43条:违反本条例第二十四条、第二十五条规定，有下列行为之一的，由县以上人民政府国土资源行政主管部门或者其他部门依据职责责令停止违法行为，对承担矿山地质环境治理恢复业务的勘查、设计、监理单位处合同约定的勘查费、设计费、监理费1倍以上2倍以下的罚款，对承担矿山地质环境治理恢复业务的施工单位处工程价款2%以上4%以下的罚款，并责令停止相应业务，降低相应资质等级；有违法所得的，没收违法所得；情节严重的，吊销相应资质证书：（一）无相应资质或者超越资质等级许可的范围承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的；（二）在矿山地质环境治理恢复工程的勘查、设计、施工以及监理活动中弄虚作假、降低治理恢复工程质量的；（三）以其他单位的名义或者允许其他单位以本单位的名义承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('00090001','00030001',NULL,'探矿权人伪造地质资料或者在地质资料汇交中弄虚作假。','负责接收地质资料的行政主管部门责令限期汇交，逾期不汇交的，自行政处罚之日起2年内，该汇交人不得申请新的探矿权、采矿权，不得承担国家出资的地质工作项目。','《地质资料管理条例》第21条：伪造地质资料或者在地质资料汇交中弄虚作假的，由负责接收地质资料的地质矿产主管部门没收、销毁地质资料，责令限期改正，处１０万元罚款；逾期不改正的，通知原发证机关吊销其勘查许可证、采矿许可证或者取消其承担该地质工作项目的资格，自处罚决定生效之日起２年内，该汇交人不得申请新的探矿权、采矿权，不得承担国家出资的地质工作项目。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','伪造地址资料或者在地址资料中弄虚作假'),('0010','00030002','拖欠采矿权价款、采矿权使用费或者矿产资源补偿费','未按照采矿权出让合同约定缴纳采矿权价款，未按规定缴纳采矿权使用费和矿产资源补偿费。','在足额缴纳采矿权价款、采矿权使用费、矿产资源补偿费以及滞纳金前，国土资源管理部门对其矿业权申请审批予以限制。满3年仍未履行付清义务的，依法予以禁入。','国土资源部《矿业权人勘察开采信息公示办法（试行）》（国土资规[2015]6号）第31条：国土资源主管部门在国土资源专项资金审批、国土资源领域工程招投标、国有土地出让、矿业权审批、授予荣誉称号等中，将矿业权人勘察开采信息公示结果作为重要考量因素，对矿业权人被列入异常名录的应依法予以限制，对矿业权人被列入严重违法名单的应依法予以禁入。第23条将未按照探矿权出让合同约定支付探矿权价款和探矿权使用费列入异常名录，满3年的列入严重违法名单。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0023','00050002','违规承接业务','在土地规划资质机构评选推荐工作中弄虚作假','具有以上失信情形的，不予评选推荐；已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。\r\n',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0024','00050002','服务质量不合格','完成的业务成果质量低劣，被投诉并经证实；工作业绩未能达到评选推荐规定','给予土地规划乙级机构推荐名录降为丙级机构推荐名录；','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,0,NULL,NULL),('0013','00030002','未履行矿山地质环境保护与治理义务','未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复的。','国土资源管理部门责令限期改正；逾期拒不改正的，国土资源管理部门5年内不受理其新的采矿权申请。','《国土资源部矿山地质环境保护规定》（国土资源部令第44号）第31条:违反本规定第十六条、第二十三条规定，未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复的，由县级以上国土资源行政主管部门责令限期改正；逾期拒不改正的，处3万元以下的罚款，5年内不受理其新的采矿权申请。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复'),('0014','00030002','未按规定缴存矿山地质环境治理恢复保证金','未按规定缴存矿山地质环境治理恢复保证金','由负责缴存工作的国土资源管理部门责令限期缴存；逾期不缴存的，颁发采矿许可证的国土资源行政主管部门不得通过其采矿活动年度报告，不受理其采矿权延续变更申请。','《国土资源部矿山地质环境保护规定》（国土资源部令第44号）第32条:违反本规定第十八条规定，未按期缴存矿山地质环境治理恢复保证金的，由县级以上国土资源行政主管部门责令限期缴存；逾期不缴存的，处3万元以下的罚款。颁发采矿许可证的国土资源行政主管部门不得通过其采矿活动年度报告，不受理其采矿权延续变更申请。 ',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','未按期缴存矿山地质环境治理恢复保证金'),('00470013','0006',NULL,'在从事测绘活动中，因泄露国家秘密被国家安全机关查处','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位受到测绘地理信息行政主管部门及相关部门行政处罚的，计入该单位的严重失信信息，自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:24:08',0,0,NULL,NULL,0,NULL,NULL),('00470014','0006',NULL,'受到其他行政处罚或被依法追究刑事责任','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位受到测绘地理信息行政主管部门及相关部门行政处罚的，计入该单位的严重失信信息，自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:24:38',0,0,NULL,NULL,0,NULL,NULL),('00480002','0006',NULL,'在测绘地理信息市场抽查检查中发现的测绘资质单位经营异常信息','自该信息生效之日起一年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位被测绘地理信息行政主管部门计入一般失信信息的，自该信息生效之日起一年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:46:40',0,0,NULL,NULL,0,NULL,NULL),('0048','0006','一般失信行为','提供虚假测绘地理信息行政许可申请材料','自该信息生效之日起一年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位被测绘地理信息行政主管部门计入一般失信信息的，自该信息生效之日起一年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:42:16',0,0,NULL,NULL,0,NULL,NULL),('00480001','0006',NULL,'不配合测绘地理信息行政主管部门依法实施监督监督检查，隐瞒、拒绝和阻碍提供有关文件、资料','自该信息生效之日起一年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位被测绘地理信息行政主管部门计入一般失信信息的，自该信息生效之日起一年内不得申请晋升测绘资质等级或者新增专业范围。',0,