。','国务院《土地复垦条例》第20条：“土地复垦义务人不依法履行土地复垦义务的，在申请新的建设用地时，有批准权的人民政府不得批准；在申请新的采矿许可证或者申请采矿许可证延续、变更、注销时，有批准权的国土资源主管部门不得批准。”',0,NULL,1,0,'superadmin','2016-05-14 10:04:48',0,0,NULL,NULL,0,NULL,NULL),('00270002','00070001',NULL,'项目设计成果未通过专家评审。','每发现1次，国土资源管理部门予以通报批评1次。同一年度内，被通报批评达3次(含)以上的，或者同一项目设计成果连续2次（含）以上未通过专家评审的，国土资源管理部门不得委托其开展下一年度土地整治项目设计。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1401',NULL,0,NULL,NULL),('0047','0006','严重失信行为','未依法送审地图或者未按照审查要求修改地图即向社会公开','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位受到测绘地理信息行政主管部门及相关部门行政处罚的，计入该单位的严重失信信息，自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:07:40',0,0,NULL,NULL,0,NULL,NULL),('00470001','0006',NULL,'违反保密规定加工、处理和利用涉密测绘结果，存在失泄密隐患被查处','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位受到测绘地理信息行政主管部门及相关部门行政处罚的，计入该单位的严重失信信息，自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:12:29',0,0,NULL,NULL,0,NULL,NULL),('00290003','00070001',NULL,'监理单位没有做到：按照施工作业程序，采取旁站、巡视、跟踪检测和平行检测等方法实施监理。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1403',NULL,0,NULL,NULL),('00420001','00050007',NULL,'不严格执行合同、截留挪用项目资金等行为','视情节轻重采取通报、追回截留或挪用的资金，情节严重者，应追究相关单位和个人经济责任','第四十三条',0,NULL,1,0,'superadmin','2016-09-07 14:16:44',1000002,0,NULL,NULL,0,NULL,NULL),('0011','00030002','因违法被依法吊销采矿许可证','因违法被依法吊销采矿许可证','自采矿许可证被吊销之日起2年内，国土资源管理部门不受理其新的采矿权申请。','《矿产资源开采登记管理办法》（国务院第241号令）第24条:采矿权人被吊销采矿许可证的，自采矿许可证被吊销之日起2年内不得再申请采矿权。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,1,NULL,NULL,0,'0003','被吊销采矿许可证'),('0012','00030002','未履行土地复垦义务','土地复垦义务人在规定的时间内没有复垦或者复垦土地不符合要求。','在改正前，国土资源行政主管部门不受理其新的采矿许可证申请以及采矿许可证延续、变更、注销申请。','《土地复垦条例》（国务院第592号令）第20条:土地复垦义务人不依法履行土地复垦义务的，在申请新的采矿许可证或者申请采矿许可证延续、变更、注销时，有批准权的国土资源主管部门不得批准。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,NULL,NULL,1,NULL,NULL),('00470008','0006',NULL,'以其他测绘资质单位名义从事测绘活动','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体系>的通知》（ 国测管发[2015]57号）第十三条 测绘资质单位受到测绘地理信息行政主管部门及相关部门行政处罚的，计入该单位的严重失信信息，自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。',0,NULL,1,0,'superadmin','2016-05-13 14:20:17',0,0,NULL,NULL,0,NULL,NULL),('00470009','0006',NULL,'允许其他单位以本单位名义从事测绘活动','自该信息生效之日起两年内不得申请晋升测绘资质等级或者新增专业范围。','《国家测绘地理信息局关于印发<测绘地理信息行业信用管理办法>和<测绘地理信息行业信用指标体