报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目施工','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,0,0,'superadmin','2016-04-14 11:12:00',0,0,'1402',NULL,0,NULL,NULL),('00290004','00070001',NULL,'监理单位没有做到：及时做好工程施工过程各种监理信息的收集、整理和归档，并保证现场记录、试验、检验、检查等资料的完整和真实。','每种情形发生1次，国土资源管理部门予以通报批评1次。同一年度内，同一法人在同一项目上被通报批评达3次（含）以上的，或者在不同项目上被通报批评达6次（含）以上的，国土资源管理部门不得委托其开展下一年度土地整治项目监理。','1.《安徽省人民政府关于印发安徽省社会信用体系建设规划纲要（2015—2020年）的通知》（ 皖政〔2015〕88号）：“依法建立政府采购供应商不良行为记录名单，对列入不良行为记录名单的供应商，在一定期限内禁止参加政府采购活动。”\r\n     2.《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-04-14 11:12:00',0,0,'1403',NULL,0,NULL,NULL