INSERT INTO `breach_info_bak` VALUES ('00180009','00050001',NULL,'违反执业操守，循私舞弊，抬高或压低评估价值，或签署不合格土地估价报告','通报批评，情节严重的处暂停执业，记6分。并根据违规情节加处警示提醒、纠错检查等处罚','《安徽省土地估价行业违规处罚记分办法》（试行）第23条。',0,NULL,1,0,'superadmin','2016-03-21 17:19:38',41,0),('00180012','00050001',NULL,'拒绝执行省估协作出的处罚决定，屡教不改','暂停执业，情节严重的处注销执业，记12分。并根据违规情节加处警示提醒、纠错检查、通报批评等处罚','《安徽省土地估价行业违规处罚记分办法》（试行）第24条。',0,NULL,1,0,'superadmin','2016-03-21 17:20:43',44,0),('0019','00050003','未遵守执业准则','执业的土地登记代理人数未达到规定要求','年检不予通过','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-03-21 17:25:17',1,0),('00190002','00050003',NULL,'无正当理由逾期不参加年检的土地登记代理机构视为未通过年检','年检不予通过','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-03-21 17:25:56',46,0),('00190004','00050003',NULL,'违反国家法律、法规执业','注销机构资质证书','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-03-21 17:26:55',48,0),('00190006','00050003',NULL,'工作失误，造成被代理人严重损失','注销机构资质证书','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-03-21 17:27:37',50,0),('00190008','00050003',NULL,'终止营业或被工商管理部门吊销、注销营业执照','注销机构资质证书','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-03-21 17:28:22',52,0),('00190009','00050003',NULL,'其他应予注销的行为','注销机构资质证书','《安徽省土地登记代理机构及登记代理人管理办法》和《安徽省土地登记代理机构年检办法》',0,NULL,1,0,'superadmin','2016-03-21 17:28:43',53,0),('0020','00050004','未遵守执业准则','未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','一年内不再委托','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',0,NULL,1,0,'superadmin','2016-03-21 17:32:29',1,0),('00200002','00050004',NULL,'迎合委托方的意愿，出具“要价”报告','一年内不再委托','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',0,NULL,1,0,'superadmin','2016-03-21 17:33:54',55,0),('00200003','00050004',NULL,'迎合委托方的意愿，出具“定价”报告','一年内不再委托','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',0,NULL,1,0,'superadmin','2016-03-21 17:34:19',56,0),('00280002','00070001',NULL,'设计单位未按照农村土地整治有关标准、规范及土地整治项目设计合同约定，编制完整的项目设计成果（包括工程施工设计）','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。 ',0,NULL,1,0,'superadmin','2016-03-21 20:23:42',65,0),('00080002','0006',NULL,'情形-2','措施-2','依据-2',0,NULL,1,0,'superadmin','2016-03-02 21:28:50',10,0),('0005','00030002','未按照批准的矿山地质环境保护与治理恢复方案履行治理义务','未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复的','5年内不受理其新的采矿权申请','《国土资源部矿山地质环境保护规定》（国土资源部令第44号）第31条:违反本规定第十六条、第二十三条规定，未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复的，由县级以上国土资源行政主管部门责令限期改正；逾期拒不改正的，处3万元以下的罚款，5年内不受理其新的采矿权申请',0,NULL,1,0,'superadmin','2016-02-26 16:40:42',0,1),('0003','00030002','违反《矿产资源开采登记管理办法》规定','采矿权人因违反矿产资源管理法律法规被吊销采矿许可证','自采矿许可证被吊销之日起2年内不受理其新的采矿权申请','《矿产资源开采登记管理办法》（国务院第241号令）第24条:采矿权人被吊销采矿许可证的，自采矿许可证被吊销之日起2年内不得再申请采矿权。',0,NULL,1,0,'superadmin','2016-02-26 15:43:14',0,1),('00210001','00050005',NULL,'被降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:38:11',58,1),('0009','00050006','未按照监测合同要求提供监测成果','未按照合同约定时间提交监测成果','限期整改，并通报批评','《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-03-05 10:58:18',1,0),('00090001','00050006',NULL,'未按照合同约定时间提交监测成果','国土资源管理部门不得委托其开展下一年度的监测活动','《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-03-05 10:59:43',11,0),('00090002','00050006',NULL,'监测成果质量不符合要求被约谈的','通报批评','《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-03-05 11:01:04',12,0),('00090004','00050006',NULL,'监测单位故意弄虚作假,情节严重','3年内，国土资源管理部门不得委托其开展监测活动','《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-03-05 11:06:24',14,0),('0024','00050005','以其他单位的名义承揽地质灾害性评估业务','被责令停业整顿','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:43:07',1,1),('00240001','00050005',NULL,'被降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:43:45',61,1),('00110001','0004',NULL,'惩戒措施期限届满，依旧没有付清价款及违约金','在全额付清前不受理其使用新的经营性建设用地申请','《中华人民共和国招标投标法》第60条：“中标人不按照与招标人订立的合同履行义务，情节严重的。取消其2年至5年内参加依法必须进行招标的项目的投标资格并将失信信息在一定范围内公开。”参加拍卖、挂牌竞买人以及协议受让的惩戒措施,参照执行。',0,NULL,1,0,'superadmin','2016-03-15 19:51:25',16,0),('00120001','0004',NULL,'已动工开发但开发建设用地面积占应动工开发建设用地总面积不足三分之一或者已投资额占总投资额不足百分之二十五，中止开发建设满一年','在动工或者接受政府依法处置前，不受理其使用新的经营性建设用地','《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。” 《闲置土地处置办法》（国土资源部53号令）第2条：“已动工开发但开发建设用地面积占应动工开发建设用地总面积不足三分之一或者已投资额占总投资额不足百分之二十五，中止开发建设满一年的国有建设用地，也可以认定为闲置土地。” ',0,NULL,1,0,'superadmin','2016-03-15 19:53:12',17,0),('00130001','0004',NULL,'限制期限届满，依旧没有纠正或者履行处罚决定','全面履行处罚决定前不受理其使用新的经营性建设用地申请','《中华人民共和国招标投标法》第60条：“中标人不按照与招标人订立的合同履行义务，情节严重的。取消其2年至5年内参加依法必须进行招标的项目的投标资格并将失信信息在一定范围内公开。”参加拍卖、挂牌竞买人以及协议受让的惩戒措施,参照执行；《国土资源部城乡建设部关于优化2015年住房及用地供应结构促进房地产市场平稳健康发展的通知》（国土资发〔2015〕37号）：“对在房地产开发和交易环节中有严重违法违规行为的房地产开发企业，国土资源主管部门可以根据住房城乡建设朱门提供的处罚信息，限制或者禁止其参与新出让房地产用地的竞买。',0,NULL,1,0,'superadmin','2016-03-15 19:55:22',18,1),('00150002','0004',NULL,'没有全面履行处罚决定','在履行前不受理其使用新的经营性建设用地申请','《中华人民共和国招标投标法》第60条：“中标人不按照与招标人订立的合同履行义务，情节严重的。取消其2年至5年内参加依法必须进行招标的项目的投标资格并将失信信息在一定范围内公开。”拍卖、挂牌、协议受让的参照执行。\r\n 《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。”\r\n',0,NULL,1,0,'superadmin','2016-03-15 19:59:39',20,1),('00160002','00050002',NULL,'转包土地利用规划编制、咨询、业务的','不予评选推荐','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:39:03',0,0),('00160005','00050002',NULL,'涂改、伪造、出借、转让资格证书，或者允许其他机构以本机构名义承担项目','已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:40:37',25,0),('00160006','00050002',NULL,'存在严重违法违规行为，给社会和行业声誉造成恶劣影响','不予评选推荐','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:41:08',26,0),('00160007','00050002',NULL,'存在严重违法违规行为，给社会和行业声誉造成恶劣影响','已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:41:26',27,0),('0017','00050002','服务质量不合格','完成的业务成果质量低劣，被投诉并经证实','给予土地规划乙级机构推荐名录降为丙级机构推荐名录','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:42:58',1,0),('00170005','00050002',NULL,'工作业绩未能达到评选推荐规定','收回资格证书并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:44:44',32,0),('00160004','00050002',NULL,'涂改、伪造、出借、转让资格证书，或者允许其他机构以本机构名义承担项目','不予评选推荐','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:40:01',24,0),('0023','00050005','超越其资质登记许可的范围','被责令停业整顿','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:40:30',1,1),('00230001','00050005',NULL,'被降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:41:01',60,1),('00280003','00070001',NULL,'设计单位未按照农村土地整治有关标准、规范及土地整治项目设计合同约定，编制完整的项目设计成果（包括工程施工设计）。','国土资源行政主管部门不得委托其开展下一年度土地整治项目设计','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-03-21 20:24:18',66,0),('0028','00070001','未全面履行土地整治项目设计义务','设计单位未按照合同约定的时间提交土地整治项目设计成果','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理',0,NULL,1,0,'superadmin','2016-03-21 20:21:15',1,0),('00280005','00070001',NULL,'项目设计成果未通过专家评审','国土资源管理部门不得委托其开展下一年度土地整治项目设计','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依