0002','00070001',NULL,'监理单位没有做到：发现存在质量、安全事故隐患，或发生质量、安全事故，应按有关规定及时采取相应的监理措施','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条、第49条。具体内容同上。',0,NULL,1,0,'superadmin','2016-03-21 20:40:07',83,0),('00320004','00070001',NULL,'监理单位没有做到：按照施工作业程序，采取旁站、巡视、跟踪检测和平行检测等方法实施监理','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条、第49条。具体内容同上。',0,NULL,1,0,'superadmin','2016-03-21 20:41:11',85,0),('00320007','00070001',NULL,'监理单位没有做到：按有关规定参加工程验收，做好相关配合工作','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条、第49条。具体内容同上。',0,NULL,1,0,'superadmin','2016-03-21 20:47:10',88,0),('00320005','00070001',NULL,'监理单位没有做到：及时做好工程施工过程各种监理信息的收集、整理和归档，并保证现场记录、试验、检验、检查等资料的完整和真实','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条、第49条。具体内容同上。',0,NULL,1,0,'superadmin','2016-03-21 20:46:13',86,0),('00030001','00030002',NULL,'基金项目实施过程中，承担单位未经省国土资源厅书面批准擅自对项目的工作地区、目标任务、工作周期、工程布置、主要实物工作量、经费使用等进行调整的','通报批评','《安徽省地质勘查基金项目管理暂行办法》（皖国土资[2007]85号）第28条：“项目承担单位和个人违反本办法规定，视情节轻重，省国土资源厅将对其进行通报批评、停止拨款、终止项目、收回已拨项目经费、取消项目申报资格等处罚。情节严重者依据有关规定追究相应的经济和法律责任。”\r\n',0,NULL,1,0,'superadmin','2016-03-21 21:04:09',99,0),('00390002','00070004',NULL,'不按规定提交项目工作报告','逾期未改正的，国土资源行政主管部门不受理其新的公益性地质工作项目申请','《安徽省公益性地质工作项目管理暂行办法》（皖国土资[2007]122号）第52条：“项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果地质资料的，按国务院《地质资料管理条例》第二十条、第二十一条规定处理。对不严格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”',0,NULL,1,0,'superadmin','2016-03-21 21:07:07',103,0),('00250001','00050005',NULL,'被降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:44:46',62,1),('00260001','00050005',NULL,'逾期未改正被依法处罚，或者1年内未按规定备案达2次','自生行政处处罚履行或者责令限期改正之日起6个月内，国土资源管理部门不得委托其开展地质灾害危险性评估','国土资源部《地质灾害危险性评估单位资质管理办法》第27条：“资质单位应当在签订地质灾害危险性评估项目合同后十日内，到项目所在地的县级国土资源管理部门进行资质和项目备案。评估项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。” 第30条：“资质单位违反本办法第二十七条的规定，不按时进行资质和项目备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下的罚款。”',0,NULL,1,0,'superadmin','2016-03-21 17:48:28',63,1),('0018','00050001','未遵守执业准则','执业过程中态度恶劣，与委托方或相关当事方口角争斗遭投诉或举报','警示提醒，并记1分','《安徽省土地估价行业违规处罚记分办法》（试行）第19条。',0,NULL,1,0,'superadmin','2016-03-21 17:14:56',1,0),('00180005','00050001',NULL,'执业土地估价师跨机构执业','纠错检查，记3分。并可根据违规情节加处警示提醒','《安徽省土地估价行业违规处罚记分办法》（试行）第21条。',0,NULL,1,0,'superadmin','2016-03-21 17:17:16',37,0),('0008','0006','行为','情形','措施','依据',0,NULL,1,0,'superadmin','2016-03-02 21:27:51',1,0),('00080001','0006',NULL,'情形-1','措施-1','依据-1',0,NULL,1,0,'superadmin','2016-03-02 21:28:25',9,0),('0004','00030002','未依法履行土地复垦义务','未按规定履行土地复垦义务','在改正前，国土资源行政主管部门不受理其新的采矿许可证申请以及与该复垦有关的采矿许可证延续、变更、注销申请','《土地复垦条例》（国务院第592号令）第20条:土地复垦义务人不依法履行土地复垦义务的，在申请新的建设用地时，有批准权的人民政府不得批准；在申请新的采矿许可证或者申请采矿许可证延续、变更、注销时，有批准权的国土资源主管部门不得批准',0,NULL,1,0,'superadmin','2016-02-26 16:39:15',0,0),('0021','00050005','在评估中弄虚作假或者故意隐瞒地质灾害真实情况','被责令停业整顿','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:37:38',1,1),('00090003','00050006',NULL,'监测成果质量不符合要求被约谈的','国土资源管理部门不得委托其开展监测活动','《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-03-05 11:01:50',13,0),('00090005','00050006',NULL,'监测单位违反保密规定将监测材料公开或使用','3年内，国土资源管理部门不得委托其开展监测活动','《安徽省国土资源监测成果检查验收办法》（皖国土资规[2014]2号）第16条：“经检查验收，发现监测单位故意弄虚作假,情节严重的，直接判定为不合格，终止国土资源监测服务合同，依法追究法律责任，取消其3年内在本省范围内承担国土资源监测任务的资格。”第17条：“一个监测年度内，同一个监测点监测成果因检查验收不合格被约谈超过1次以的，取消其２年内在本省范围内承担国土资源监测任务的资格。”',0,NULL,1,0,'superadmin','2016-03-05 11:06:57',15,0),('0022','00050005','无资质证书','被责令停业整顿','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:38:59',0,1),('00220001','00050005',NULL,'被降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:39:32',59,1),('00320008','00070001',NULL,'同一年度内，同一项目上被通报批评超过2次，或者在不同项目上被通报批评超过5次','国土资源管理部门不得委托其开展下一年度土地整治项目监理','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条、第49条。具体内容同上。',0,NULL,1,0,'superadmin','2016-03-21 20:47:51',89,0),('00350001','00070002',NULL,'降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人