标资格并将失信信息在一定范围内公开。”拍卖、挂牌、协议受让的参照执行。\r\n 《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。”\r\n',0,NULL,1,0,'superadmin','2016-03-15 19:56:36',1,1),('00150001','0004',NULL,'擅自非法转让出让土地','自行政处罚决定书生效之日起4年内不受理其使用新的经营性建设用地申请','《中华人民共和国招标投标法》第60条：“中标人不按照与招标人订立的合同履行义务，情节严重的。取消其2年至5年内参加依法必须进行招标的项目的投标资格并将失信信息在一定范围内公开。”拍卖、挂牌、协议受让的参照执行。\r\n 《国务院关于坚决遏制部分城市房价过快上涨的通知》（国发〔2010〕10号）：“国土资源部门要加大专项整治和清理力度，严格依法查处土地闲置及炒地行为，并限制有违法违规行为的企业新购置土地。”\r\n',0,NULL,1,0,'superadmin','2016-03-15 19:59:19',19,1),('0016','00050002','违规承接业务','在土地规划资质机构评选推荐工作中弄虚作假','不予评选推荐','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:37:43',1,0),('00160001','00050002',NULL,'在土地规划资质机构评选推荐工作中弄虚作假','已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:38:26',21,0),('00160003','00050002',NULL,'转包土地利用规划编制、咨询、业务的','已列入推荐名录的予以除名并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:39:25',0,0),('00170001','00050002',NULL,'完成的业务成果质量低劣，被投诉并经证实','给予丙级机构撤销推荐','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:43:25',28,0),('00170002','00050002',NULL,'完成的业务成果质量低劣，被投诉并经证实','收回资格证书并向社会公布','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:43:48',29,0),('00170003','00050002',NULL,'工作业绩未能达到评选推荐规定','给予土地规划乙级机构推荐名录降为丙级机构推荐名录','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:44:07',30,0),('00170004','00050002',NULL,'工作业绩未能达到评选推荐规定','给予丙级机构撤销推荐','中国土地学会《土地规划机构评选推荐管理办法》第24条。\r\n安徽省土地学会《安徽省土地规划机构评选推荐管理办法》第24条。',0,NULL,1,0,'superadmin','2016-03-21 15:44:27',31,0),('0025','00050005','允许其他单位以本单位的名义承揽地质灾害危险性评估业务','被责令停业整顿','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 17:44:14',1,1),('0026','00050005','签订地质灾害危险性评估项目合同后，未按规定到项目所在地的国土资源管理部门进行资质和项目备案','被责令限期改正','不得委托其开展地质灾害危险性评估','国土资源部《地质灾害危险性评估单位资质管理办法》第27条：“资质单位应当在签订地质灾害危险性评估项目合同后十日内，到项目所在地的县级国土资源管理部门进行资质和项目备案。评估项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。” 第30条：“资质单位违反本办法第二十七条的规定，不按时进行资质和项目备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下的罚款。”',0,NULL,1,0,'superadmin','2016-03-21 17:47:55',1,0),('0027','00050005','地质灾害危险性评估资质单位承担的地质灾害危险性评估项目发生重大质量事故','被降低资质等级','自被降低资质等级之日起2年内，国土资源管理部门不得委托其开展地质灾害危险性评估','国土资源部《地质灾害危险性评估单位资质管理办法》第26条：“资质单位承担的地质灾害危险性评估项目发生重大质量事故的，资质单位应当停止从业活动，由原审批机关对其资质等级进行重新核定。”',0,NULL,1,0,'superadmin','2016-03-21 17:49:07',1,1),('00180001','00050001',NULL,'不维护行业形象，言行不当，对土地估价行业造成不良影响','警示提醒，并记1分','《安徽省土地估价行业违规处罚记分办法》（试行）第19条。',0,NULL,1,0,'superadmin','2016-03-21 17:15:24',33,0),('00180002','00050001',NULL,'未经所在土地估价机构同意，在其他土地估价机构参与土地评估业务并获取经济利益','纠错检查，记2分。并可根据违规情节加处警示提醒','《安徽省土地估价行业违规处罚记分办法》（试行）第20条。',0,NULL,1,0,'superadmin','2016-03-21 17:15:56',34,0),('00180003','00050001',NULL,'未按规定参加继续教育，学时未达到规定要求','纠错检查，记2分。并可根据违规情节加处警示提醒','《安徽省土地估价行业违规处罚记分办法》（试行）第20条。',0,NULL,1,0,'superadmin','2016-03-21 17:16:20',35,0),('00180004','00050001',NULL,'未按规程要求现场踏勘，不核实评估资料，未尽到估价师责任','纠错检查，记3分。并可根据违规情节加处警示提醒','《安徽省土地估价行业违规处罚记分办法》（试行）第21条。',0,NULL,1,0,'superadmin','2016-03-21 17:16:46',36,0),('00180006','00050001',NULL,'违反法律法规要求或未经委托方许可，泄露商业秘密和土地估价报告内容','通报批评，记4分。并可根据违规情节加处警示提醒、纠错检查等处罚','《安徽省土地估价行业违规处罚记分办法》（试行）第22条。',0,NULL,1,0,'superadmin','2016-03-21 17:18:20',38,0),('00280001','00070001',NULL,'设计单位未按照合同约定的时间提交土地整治项目设计成果','国土资源行政主管部门不得委托其开展下一年度土地整治项目设计','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-03-21 20:22:20',64,0),('00280004','00070001',NULL,'项目设计成果未通过专家评审','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工、监理、结(决)算、审计等工作中弄虚作假的，除按有关规定处理外，一经发现暂停两年从事土地整理复垦开发相关工作。情节严重的在全省范围内永久性禁止从事土地整理复垦开发的相关工作。情节特别严重，造成严重后果的，移交相关部门进行处理。',0,NULL,1,0,'superadmin','2016-03-21 20:24:50',67,0),('00280007','00070001',NULL,'不按照合同约定提供施工阶段的有关设计的修改完善、变更等设计服务','通报批评','《安徽省土地整理复垦开发项目管理办法》（皖国土资〔2009〕155号）第28条：项目建设单位应当按照有关法律法规的规定和合同的约定，各司其职，各负其责，做好项目实施的各项工作。项目施工单位应当按照项目设计和有关技术标准进行施工。建立质量责任制，确定工程及工段的项目经理、技术负责人和施工管理负责人。对出现质量问题或验收不合格的工程，负责返工或返修。对因违反项目设计、施工合同延误农时或造成其他损失的，依法负责赔偿。工程监理单位应当依照项目设计、有关技术标准和相关合同进行工程监理，对工程投资、质量和进度进行控制，承担监理责任。项目设计单位提供的项目规划设计应当包括工程施工设计。其成果资料必须满足项目建设和工程施工的要求。项目设计单位应当参与设计交底，负责项目实施中有关设计的咨询、指导等技术性服务工作。项目设计确需变更的，负责按有关规定进行修改。项目承担单位负责项目施工现场管理，对施工单位、监理单位和设计单位进行管理，控制工程投资、质量和进度；组织分部、分项工程验收；协调处理项目实施中出现的矛盾和问题，维护农民工合法权益，做好工程设施移交工作；即时收集整理项目档案资料。第49条：规划设计单位、施工企业、监理机构和审计单位等在项目立项核查、规划设计和变更、项目预算、施工