格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”',0,NULL,1,0,'superadmin','2016-03-21 21:08:58',106,0),('0040','00070004','违反《安徽省省外境外地质勘查基金项目申报暂行办法》规定','省外境外地质勘查基金项目申请人采用虚假手段骗取地质勘查基金，截留、挪用省地质勘查基金项目经费，伪造、隐匿技术资料和成果资料的','不受理其新的省外境外地质勘查基金项目申请','《安徽省省外境外地质勘查基金项目申报暂行办法》（皖国土资[2008]337号）第14条：“采用虚假手段骗取地质勘查基金，截留、挪用省地质勘查基金项目经费，伪造、隐匿技术资料和成果资料的，省地勘基金管理机构有权全额收回项目基金，取消以后年度项目申请资格，并追究其经济和法律责任。”',0,NULL,1,0,'superadmin','2016-03-21 21:09:37',1,0),('0033','00070002','地质灾害治理工程勘查、设计、施工、监理资质单位在签订地质灾害治理工程勘查、设计、施工、监理项目合同后，未到项目所在地的国土资源管理部门进行资质和项目备案','责令限期改正','国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理','国土资源部《地质灾害治理工程勘查设计施工单位资质管理办法》第27条：“承担地质灾害治理工程项目的资质单位，应当在项目合同签订后十日内，到工程所在地的县级国土资源管理部门备案。地质灾害治理工程项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。”第29条：“资质单位不按照本办法第二十七条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期仍不改正的逾期不改的，可以处一万元以下罚款。”国土资源部《地质灾害治理工程监理单位资质管理办法》第25条：“地质灾害治理工程监理资质单位，对承担的监理项目，应当在监理合同签订后十日内，到工程所在地县级国土资源管理部门备案。监理项目跨行政区域的，向项目所跨行政区域共同的上一级国土资源管理部门备案。”第27条：“资质单位不按照本办法第二十五条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下罚款。”',0,NULL,1,0,'superadmin','2016-03-21 20:55:00',1,0),('00390004','00070004',NULL,'私自截留、挪用项目资金','逾期未改正，国土资源行政主管部门不受理其新的公益性地质工作项目申请','《安徽省公益性地质工作项目管理暂行办法》（皖国土资[2007]122号）第52条：“项目承担单位发生伪造资料、弄虚作假、不按规定汇交项目成果地质资料的，按国务院《地质资料管理条例》第二十条、第二十一条规定处理。对不严格执行合同或不提交项目工作报告、截留挪用项目资金等行为的，视情节轻重进行通报、追回截留或挪用的资金，不受理新项目的申请，取消参与竞争项目的资格，停止或终止项目等处罚；情节严重者，追究相应的经济责任。”\r\n',0,NULL,1,0,'superadmin','2016-03-21 21:08:15',105,0),('00400001','00070004',NULL,'项目成果经评审不合格','不受理其新的省外境外地质勘查基金项目申请','《安徽省省外境外地质勘查基金项目申报暂行办法》（皖国土资[2008]337号）第14条：“采用虚假手段骗取地质勘查基金，截留、挪用省地质勘查基金项目经费，伪造、隐匿技术资料和成果资料的，省地勘基金管理机构有权全额收回项目基金，取消以后年度项目申请资格，并追究其经济和法律责任。”',0,NULL,1,0,'superadmin','2016-03-21 21:10:07',107,0),('00330001','00070002',NULL,'逾期未改正被依法处罚，或者在1年内未按规定备案达2次','自处罚履行或者被责令限期改正之日起6个月内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理','国土资源部《地质灾害治理工程勘查设计施工单位资质管理办法》第27条：“承担地质灾害治理工程项目的资质单位，应当在项目合同签订后十日内，到工程所在地的县级国土资源管理部门备案。地质灾害治理工程项目跨行政区域的，资质单位应当向项目所跨行政区域共同的上一级国土资源管理部门备案。”第29条：“资质单位不按照本办法第二十七条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期仍不改正的逾期不改的，可以处一万元以下罚款。”国土资源部《地质灾害治理工程监理单位资质管理办法》第25条：“地质灾害治理工程监理资质单位，对承担的监理项目，应当在监理合同签订后十日内，到工程所在地县级国土资源管理部门备案。监理项目跨行政区域的，向项目所跨行政区域共同的上一级国土资源管理部门备案。”第27条：“资质单位不按照本办法第二十五条的规定进行备案的，由县级以上国土资源管理部门责令限期改正；逾期不改的，可以处一万元以下罚款。”',0,NULL,1,0,'superadmin','2016-03-21 20:55:36',94,0),('00340001','00070002',NULL,'降低资质等级','自处罚履行之日起2年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 20:56:54',95,0),('0035','00070002','无资质证书、或超越其资质登记许可的范围、以其他单位的名义承揽地质灾害治理工程勘查、设计、施工、监理资质单位业务，或者允许其他单位以本单位的名义承揽地质灾害治理工程勘查、设计、施工、监理资质单位业务','责令停业整顿','自处罚履行之日起1年内，国土资源管理部门不得委托其开展地质灾害治理工程项目勘查、设计、施工、监理','国务院《地质灾害防治条例》第44条：“违反本条例规定，有下列行为之一的，由县级以上人民政府国土资源主管部门或者其他部门依据职责责令停止违法行为，对地质灾害危险性评估单位、地质灾害治理工程勘查、设计或者监理单位处合同约定的评估费、勘查费、设计费或者监理酬金１倍以上２倍以下的罚款，对地质灾害治理工程施工单位处工程价款2％以上4％以下的罚款，并可以责令停业整顿，降低资质等级；有违法所得的，没收违法所得；情节严重的，吊销其资质证书；构成犯罪的，依法追究刑事责任；给他人造成损失的，依法承担赔偿责任：（一）在地质灾害危险性评估中弄虚作假或者故意隐瞒地质灾害真实情况的；（二）在地质灾害治理工程勘查、设计、施工以及监理活动中弄虚作假、降低工程质量的；（三）无资质证书或者超越其资质等级许可的范围承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工及监理业务的；（四）以其他单位的名义或者允许其他单位以本单位的名义承揽地质灾害危险性评估、地质灾害治理工程勘查、设计、施工和监理业务的。”',0,NULL,1,0,'superadmin','2016-03-21 20:57:24',1,0),('0036','00070003','违规实施矿山地质环境治理项目勘查、设计、施工、监理行为','无相应资质或者超越资质等级许可的范围承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务','被责令停止相关业务的，在改正前不得承担新的地质灾害治理工程项目勘查、设计、施工、监理项目。被吊销相应资质证书的，不得开展勘查、设计、施工、监理活动','《安徽省矿山地质环境保护条例》第43条:违反本条例第二十四条、第二十五条规定，有下列行为之一的，由县以上人民政府国土资源行政主管部门或者其他部门依据职责责令停止违法行为，对承担矿山地质环境治理恢复业务的勘查、设计、监理单位处合同约定的勘查费、设计费、监理费1倍以上2倍以下的罚款，对承担矿山地质环境治理恢复业务的施工单位处工程价款2%以上4%以下的罚款，并责令停止相应业务，降低相应资质等级；有违法所得的，没收违法所得；情节严重的，吊销相应资质证书：\r\n（一）无相应资质或者超越资质等级许可的范围承揽矿山地质环境治理恢复工程的勘查、设计、施工及监理业务的；（二）在矿山地质环境治理恢