  `RULE` varchar(128) DEFAULT NULL COMMENT '规则表达式',
  `TIPINFO` varchar(128) DEFAULT NULL COMMENT '提示信息',
  `MEMO` text COMMENT '备注',
  PRIMARY KEY (`RULEID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='表单验证规则表';

