#
# Structure for table "form_field"
#

DROP TABLE IF EXISTS `form_field`;
CREATE TABLE `form_field` (
  `FIELDID` decimal(65,30) NOT NULL COMMENT '主键',
  `TABLEID` decimal(65,30) DEFAULT NULL COMMENT '表ID',
  `FIELDNAME` varchar(128) DEFAULT NULL COMMENT '字段数据库名',
  `FIELDLABEL` varchar(128) DEFAULT NULL COMMENT '字段中文名称',
  `FIELDTYPE` varchar(128) DEFAULT NULL COMMENT '字段类型',
  `FIELDSIZE` decimal(65,30) DEFAULT NULL COMMENT '字段长度',
  `ISPRIMARY` decimal(65,30) DEFAULT NULL COMMENT '是否主键',
  `ISREQUIRED` decimal(65,30) DEFAULT NULL COMMENT '是否为空',
  `FIELDDSCP` text COMMENT '字段描述',
  `FOREIGNKEY` varchar(64) DEFAULT NULL COMMENT '外键关联key',
  `FOREIGNTABLE` varchar(64) DEFAULT NULL COMMENT '关联表',
  `ISLIST` decimal(65,30) DEFAULT NULL COMMENT '是否列表',
  `ISQUERY` decimal(65,30) DEFAULT NULL COMMENT '是否查询',
  `SHOWFORMAT` text COMMENT '显示格式\r\n如日期显示yyyy-MM-dd\r\n数字 如 000.00',
  `ISDESIGNSHOW` decimal(65,30) DEFAULT NULL COMMENT '1=设计的可视化2=设计的不可视化3=手工加上',
  `STATUS` decimal(65,30) DEFAULT NULL COMMENT '1=删除；0=未删除',
  `CONTROLTYPE` decimal(65,30) DEFAULT NULL COMMENT '控件类型，如附件、时间、密码框、文本框等',
  `REGULAREXP` text,
  `ISPUBLIC` decimal(65,30) DEFAULT NULL,
  `LOCATION` decimal(65,30) DEFAULT NULL,
  `OPTIONS` text,
  `LOADSELECT` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`FIELDID`),
  KEY `TABLEID` (`TABLEID`),
  CONSTRAINT `form_field_ibfk_1` FOREIGN KEY (`TABLEID`) REFERENCES `form_table` (`TABLEID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='表的字段表';

