INSERT INTO `quick_table` VALUES ('00010002','信用类型1',NULL,'失信行为1-2','失信行为1-2','失信行为1-2',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-01-26 11:19:29',3.000000000000000000000000000000,0.000000000000000000000000000000),('0001','信用类型1','失信行为1','失信行为1','失信行为1','失信行为1',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-01-26 11:16:32',0.000000000000000000000000000000,0.000000000000000000000000000000),('0004','采矿权市场信用','未依法履行土地复垦义务','未按规定履行土地复垦义务','在改正前，国土资源行政主管部门不受理其新的采矿许可证申请以及与该复垦有关的采矿许可证延续、变更、注销申请','《土地复垦条例》（国务院第592号令）第20条:土地复垦义务人不依法履行土地复垦义务的，在申请新的建设用地时，有批准权的人民政府不得批准；在申请新的采矿许可证或者申请采矿许可证延续、变更、注销时，有批准权的国土资源主管部门不得批准',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 16:39:15',1.000000000000000000000000000000,0.000000000000000000000000000000),('0007','矿产权价格评估信用','未遵守执业准则','未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','劝戒','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 17:32:19',1.000000000000000000000000000000,0.000000000000000000000000000000),('00070001','矿产权价格评估信用',NULL,'未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','警告','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 17:33:01',4.000000000000000000000000000000,0.000000000000000000000000000000),('00070002','矿产权价格评估信用',NULL,'未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','内部通报批评','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 17:33:52',5.000000000000000000000000000000,0.000000000000000000000000000000),('00070003','矿产权价格评估信用',NULL,'未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','限期整改','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 17:34:20',6.000000000000000000000000000000,0.000000000000000000000000000000),('00010001','信用类型1',NULL,'失信行为1-12','失信行为1-1','失信行为1-1',NULL,NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-01-26 11:17:01',0.000000000000000000000000000000,0.000000000000000000000000000000),('0005','采矿权市场信用','未按照批准的矿山地质环境保护与治理恢复方案履行治理义务','未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复的','5年内不受理其新的采矿权申请','《国土资源部矿山地质环境保护规定》（国土资源部令第44号）第31条:违反本规定第十六条、第二十三条规定，未按照批准的矿山地质环境保护与治理恢复方案治理的，或者在矿山被批准关闭、闭坑前未完成治理恢复的，由县级以上国土资源行政主管部门责令限期改正；逾期拒不改正的，处3万元以下的罚款，5年内不受理其新的采矿权申请',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 16:40:42',1.000000000000000000000000000000,0.000000000000000000000000000000),('0003','采矿权市场信用','违反《矿产资源开采登记管理办法》规定','采矿权人因违反矿产资源管理法律法规被吊销采矿许可证','自采矿许可证被吊销之日起2年内不受理其新的采矿权申请','《矿产资源开采登记管理办法》（国务院第241号令）第24条:采矿权人被吊销采矿许可证的，自采矿许可证被吊销之日起2年内不得再申请采矿权。',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 15:43:14',1.000000000000000000000000000000,0.000000000000000000000000000000),('0006','采矿权市场信用','未履行缴存矿山地质环境治理恢复保证金义务','未按期足额缴存矿山地质环境治理恢复保证金','由负责缴存工作的国土资源行政主管部门责令限期缴存；逾期不缴存的，颁发采矿许可证的国土资源行政主管部门不得通过其采矿活动年度检查报告，不受理其采矿权延续变更申请','《国土资源部矿山地质环境保护规定》（国土资源部令第44号）第32条:违反本规定第十八条规定，未按期缴存矿山地质环境治理恢复保证金的，由县级以上国土资源行政主管部门责令限期缴存；逾期不缴存的，处3万元以下的罚款。颁发采矿许可证的国土资源行政主管部门不得通过其采矿活动年度报告，不受理其采矿权延续变更申请。',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 16:43:11',1.000000000000000000000000000000,0.000000000000000000000000000000),('00070004','矿产权价格评估信用',NULL,'未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','公开谴责','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 17:35:21',7.000000000000000000000000000000,0.000000000000000000000000000000),('00070005','矿产权价格评估信用',NULL,'未充分调研或隐瞒信息、曲解信息、故意高估或低估价值、弄虚作假，出具虚假评估报告','终止合同','《矿业权评估管理办法（试行）》（国土资发〔2008〕174号），安徽省国土资源厅、财政厅与矿业权价款评估单位签订的采购合同',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 17:36:46',8.000000000000000000000000000000,0.000000000000000000000000000000),('00010003','信用类型1',NULL,'失信行为1-2','失信措施1-3','依据',NULL,NULL,1.000000000000000000000000000000,0.000000000000000000000000000000,'superadmin','2016-02-26 16:21:53',0.000000000000000000000000000000,0.000000000000000000000000000000);

