INSERT INTO `xzcf_info` VALUES (401.000000000000000000000000000000,2596.000000000000000000000000000000,NULL,'0004','00080027','2014年12月份，淮丰汽车运输有限公司未经批准，擅自占用梅桥镇淮丰村5.84亩集体土地用于厂房和生产场地建设，其中厂房及生产场地面积3.18亩、未硬化面积2.66亩。无任何一点方面手续，属于非法占地。',NULL,'蚌国土支处字【2015】第019号',NULL,'2015-07-22','2015-07-22','2015-10-21','1、退还非法占用的5.84亩土地给淮上区梅桥镇淮丰村农民集体；2、没收企业在非法占用土地上新建的建筑物2122.19平方米；3、按照每平方米10元的标准，罚款38933元，上缴市财政。',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'bbs96','00080027','2016-08-02 15:00:40',0.000000000000000000000000000000,NULL,NULL,'1','0043_01','0043_01','0043_01','0',0.000000000000000000000000000000,NULL,'0',NULL,NULL,1.000000000000000000000000000000,NULL,NULL,NULL,NULL,'2017-02-21 15:59:16'),(402.000000000000000000000000000000,2597.000000000000000000000000000000,NULL,'0004','00080027','冯开旺在未经批准的情况下，擅自占用禹会区马城镇前郢村1.57亩集体土地建设住房。',NULL,'蚌国土支处字【2014】第69号',NULL,'2014-01-23','2014-01-23','2014-04-22','拆除新建建筑物及其附属设施1048.76平方米，将非法占用的1.57亩集体土地退回给前郢村集体，并恢复高中条件',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'bbs96','00080027','2016-08-02 15:17:01',0.000000000000000000000000000000,NULL,NULL,'0','0043_01','0043_01','0043_01','0',0.000000000000000000000000000000,NULL,'1',NULL,NULL,1.000000000000000000000000000000,NULL,NULL,NULL,NULL,'2017-02-21 15:59:16'),(403.000000000000000000000000000000,2598.000000000000000000000000000000,NULL,'0004','000800050008','芜湖县自来水厂未经批准擅自占用湾沚镇桃园村1.19亩集体土地建设自来水厂。',NULL,'芜国土监罚字[2016]02号',NULL,'2016-02-06','2016-02-06','2016-03-05','1、责令退还非法占用的793平方米集体土地；2、没收已建成的220平方米厂房；3、并对其非法占用土地罚处10元/平方米，计人民币柒仟玖佰叁拾元整。',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'whwhx91','000800050008','2016-08-02 15:26:24',0.000000000000000000000000000000,NULL,NULL,'1','0043_01','0043_01','0043_01','0',0.000000000000000000000000000000,NULL,'0',NULL,NULL,1.000000000000000000000000000000,NULL,NULL,NULL,NULL,'2017-02-21 15:59:16'),(404.000000000000000000000000000000,2599.000000000000000000000000000000,NULL,'0004','000800050008','芜湖蟠龙消防装备有限公司未经批准擅自占用湾沚镇蟠龙村1.2亩集体土地建设厂房。',NULL,'芜国土监罚字[2016]01号',NULL,'2016-02-06','2016-02-06','2016-03-05','1、责令退还非法占用的800平方米集体土地；2、没收已建成的567平方米厂房；3、并对其非法占用土地罚处15元/平方米，计人民币壹万贰仟元整。',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'whwhx91','000800050008','2016-08-02 15:31:32',0.000000000000000000000000000000,NULL,NULL,'1','0043_01','0043_01','0043_01','0',0.000000000000000000000000000000,NULL,'0',NULL,NULL,1.000000000000000000000000000000,NULL,NULL,NULL,NULL,'2017-02-21 15:59:16'),(405.000000000000000000000000000000,2614.000000000000000000000000000000,NULL,'0004','000800270009','未经批准，非法占用土地建厂房',NULL,'固国土资罚字（2015）0705号',NULL,'2015-07-31','2015-07-31','2015-08-14','1、责令退还非法占用的土地；2、拆除在非法占用的土地上新建的建筑物和其他设施、恢复土地原状；3、处以罚款人民币28000.00元，',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'bbgzx92','000800270009','2016-08-03 15:20:27',0.000000000000000000000000000000,NULL,NULL,'1','0043_01','0043_01','0043_01','0',0.000000000000000000000000000000,NULL,'0',NULL,NULL,1.000000000000000000000000000000,NULL,NULL,NULL,NULL,'2017-02-21 15:59:16'),(406.000000000000000000000000000000,2642.000000000000000000000000000000,NULL,'0004','00080005','擅自改变土地用途',NULL,'芜土执法[2015]6号',NULL,'2015-01-22','2015-01-22','2015-04-21','1、责令交还土地13587.24平方米；2、对非法占用13587.24平方米土地的行为处以罚款，罚款额为每平方米30元，计407617.2元。',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'whs91','00080005','2016-08-05 15:15:51',0.000000000000000000000000000000,NULL,NULL,'1','0003','0003','0003','0',1.000000000000000000000000000000,NULL,'0',NULL,NULL,1.000000000000000000000000000000,NULL,NULL,NULL,NULL,'2017-02-21 15:59:16'),(421.000000000000000000000000000000,2637.000000000000000000000000000000,NULL,'0004','000800050008','闲置土地',NULL,'cs09090',NULL,'2016-08-31','2016-08-31',NULL,'cd',NULL,0.000000000000000000000000000000,0.000000000000000000000000000000,'whwhx91','000800050008','2016-08-31 09:58:09',0.000000000000000000000000000000,NULL,NULL,'0','0002','0002','0002