#
# Function "currval"
#

DROP FUNCTION IF EXISTS `currval`;
CREATE FUNCTION `currval`(v_seq_name VARCHAR(50)) RETURNS int(11)
begin        
    declare value integer;         
    set value = 0;         
    select current_val into value  from sequence where seq_name = v_seq_name;   
   return value;   
end;

#
# View "discredit_info_view"
#

DROP VIEW IF EXISTS `discredit_info_view`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `discredit_info_view`
  AS
SELECT
  dis.`ID` AS 'id',
  dis.`UNITID` AS 'unitid',
  u.`XZQH` AS 'xzqh',
  dis.`CREATE_DATE` AS 'create_date',
  u.`UNITTYPE` AS 'unittype',
  dis.`XY_TYPE` AS 'xy_type'
FROM
  (`discredit_info` dis
    JOIN `sys_unit` u)
WHERE
  (dis.`UNITID` = u.`ID`);
